import React from 'react';
// import Logo from '/logo.svg'

function Card() {
  return <div className='flex items-center justify-center'>
        <div className="card text-center rounded-md shadow flex justify-center items-center p-5 space-y-3 h-22 w-2/4 flex-col">
            <p className="card-text">
            Wow! This is amazing. So glad i came across Spatialnode. I created a GIS portfolio for free in five minutes. So easy to use.
            </p>
            <p>@username</p>
        </div>
  </div>;
}

export default Card;
